      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cText\u003e\u003c![CDATA[# Binnewitt \\\u0026 Schnepf 2023 (Supplementary Material)\n\nThis is the supplementary material for the article \n\n```Binnewitt, Johanna; Schnepf, Timo (2023): \nJoin us to turn the wor(l)d greener! \u2013 \nInvestigating online apprenticeship advertisements\u2019 reference to environmental sustainability. \nIn: Zum Konzept der Nachhaltigkeit in Arbeit, Beruf und Bildung - Stand in Forschung und Praxis. AG BFN.```\n\nIt consists of the following\n\n1. Treemap chart for most frequent keyword matches for the three association level categories\n2. Line charts for the development of keywords at the occupational level\n3. Talk at Bertelsmann OJA Forum 2021\n\nThe article can be found [here](https://www.bibb.de/dienst/publikationen/de/19032?referrer=/dienst/publikationen/de/suche?publication_search_result_voe%255BfreeTextSearch%255D%3Dschnepf%2520_author:5350%26publication_search_result_voe%255BfromYear%255D%3D%26publication_search_result_voe%255BtoYear%255D%3D%26publication_search_result_voe%255Bseries%255D%3D%26publication_search_result_voe%255Blanguage%255D%3D).\n\nThe keyword list can be found [at bibb.de.](https://www.bibb.de/de/153062.php)\n\n## 1. Keyword matches treemap\n\nThe size of the squares represents the number of apprenticeship job ads in the corpus. The coloring represents\nthe number of keywords matches. The greener the square, the more \"green\" keywords were found per occupation.\n\nYou can move the mouse over the treemap to get further information about the percentage of job ad matches, which keywords \nmatched and how often they matched. Moving the mouse over the frames sums up the keyword matches\nfor higher level aggregates of occupations (KldB 2010 3-digit and 1-digit). You can zoom in by clicking on the \nframes of interest. For mobile devices touch the squares longer for further information.\n\nBelow you can filter the keyword matches by their association to environmental sustainablility (ES):]]\u003e\u003c/Text\u003e\u003cSelect type=\"dropdown\"\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Show only weakly associated keywords to ES\" responsive=\"true\" scale=\"1.0\" src=\"ref://26fd3b6e98\" caption=\"Treemap showing all weakly associated keyword matches with all apprenticeship job ads from 2011 to 2019.\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Show only medium associated keywords to ES\" responsive=\"true\" scale=\"1.0\" src=\"ref://ca350dbcd3\" caption=\"Treemap showing all medium associated keyword matches with all apprenticeship job ads from 2011 to 2019.\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Show only strongly associated keywords to ES\" responsive=\"true\" scale=\"1.0\" src=\"ref://dfa03474a0\" caption=\"Treemap showing all strongly associated keyword matches with all apprenticeship job ads from 2011 to 2019.\"/\u003e\u003c/Select\u003e\u003cText\u003e\u003c![CDATA[## 2. Development of keyword matches at occupational level\n\nBelow you can select an occupation of interest. Hovering over the line chart gives further insights such as \nthe correpsoning keywords for each category and year. You can deactivate categories in the legend by clicking on them.]]\u003e\u003c/Text\u003e\u003cSelect type=\"dropdown\"\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Occupations in farming (without specialisation)-skilled tasks (11102)\" responsive=\"true\" scale=\"1.0\" src=\"ref://e294477cbf\" caption=\"Occupations in farming (without specialisation)-skilled tasks (11102)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Occupations in livestock farming (without poultry farming)-skilled tasks (11212)\" responsive=\"true\" scale=\"1.0\" src=\"ref://1b137b34c1\" caption=\"Occupations in livestock farming (without poultry farming)-skilled tasks (11212)\"/\u003e\
